def threeSum(nums):
    n = len(nums)
    if(n < 2):
        return []
    out = set()
    nums.sort()
    for i in range(n-2):
        l = i+1
        r = n-1
        while(l < r):
            if(nums[i]+nums[l]+nums[r] == 0):
                res = (nums[i], nums[l], nums[r])
                out.add(res)
                l += 1
                r -= 1
            elif(nums[i]+nums[l]+nums[r] < 0):
                l += 1
            else:
                r -= 1
    return list(out)

#Complexity:
#Time: O(n^2)
#Space: O(n)

